import React from 'react'
import "./Login.css";

function Login() {
    return (
        <div className='login'>
            <Link to='/'>
                <img
                    className='login__logo'
                    src='https://pngimg.com/uploads/amazon/amazon_PNG11.png'
                    alt='logo'
                />
            </Link>
        </div>
    )
}

export default Login
